DROP TABLE IF EXISTS `sys_menu`;
CREATE TABLE `sys_menu` (
    `id`          int          NOT NULL AUTO_INCREMENT COMMENT '主键 Id',
    `menu_name`   varchar(255) DEFAULT NULL COMMENT '菜单名',
    `path`        varchar(255) DEFAULT NULL COMMENT '路由地址',
    `component`   varchar(255) DEFAULT NULL COMMENT '组件路径',
    `visible`     varchar(255) DEFAULT NULL COMMENT '菜单可见性(0显示 1隐藏)',
    `status`      varchar(255) DEFAULT NULL COMMENT '菜单状态 (0正常 1停用)',
    `permission`  varchar(255) DEFAULT NULL COMMENT '权限标识',
    `icon`        blob         DEFAULT NULL COMMENT '菜单图标',
    `create_by`   bigint       DEFAULT NULL COMMENT '创建人',
    `create_time` datetime     DEFAULT NULL COMMENT '创建时间',
    `update_by`   bigint       DEFAULT NULL COMMENT '更新人',
    `update_time` datetime     DEFAULT NULL COMMENT '更新时间',
    `del_flag`    varchar(255) DEFAULT NULL COMMENT '是否删除(0未删除 1已删除)',
    `remark`      varchar(255) DEFAULT NULL COMMENT '备注',
    PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci COMMENT '菜单权限表';
